import React, {useState} from 'react'
import Todo from './Todo'
import './TodoList.css'

const TodoList = ({ todos }) => {


    return (
        <div className="grid">
            {todos.map((element) => {
                return (
                    <Todo key={element.id} task={element} />
                )
            })}
        </div>
    )
}

export default TodoList
